@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix sys: <http://www.example.com/system#> .

sys:User 
    rdf:type owl:Class ;
    rdf:subClassOf 
        [ rdf:type owl:Restriction ;
          owl:onProperty sys:canChange ;
          owl:someValuesFrom sys:Pin
        ] .

sys:canChange
    rdf:type owl:ObjectProperty .

sys:Pin 
    rdf:type owl:Class .

sys:Securely
    rdf:type owl:Class ;
    rdf:subClassOf 
        [ rdf:type owl:Restriction ;
          owl:onProperty sys:appliesTo ;
          owl:allValuesFrom sys:Pin
        ] .

sys:appliesTo
    rdf:type owl:ObjectProperty .
